import React from "react";

import "./App.css";

const App = () => {
  return (
    <div className="goals">
      <h2>Course Goals</h2>
      <ul className="goal-list">
        <li>Finish the course</li>
        <li>Learn all abot the course</li>
        <li>Help other students in the course Q&A</li>
      </ul>
    </div>
  );
};

export default App;
